"use strict";

const nearestExit = (maze, entrance) => {
    const m = maze.length, n = maze[0].length;
    const [i, j] = entrance;
    const q = [[i, j]];
    maze[i][j] = '+';
    let ans = 0;
    while (q.length) {
        ans += 1;
        const len = q.length;
        for (let k = 0; k < len; k++) {
            const [i, j] = q.shift();
            for (const [a, b] of [[0, -1], [0, 1], [-1, 0], [1, 0]]) {
                const x = i + a, y = j + b;
                if (0 <= x && x < m && 0 <= y && y < n && maze[x][y] === '.') {
                    if (x === 0 || x === m - 1 || y === 0 || y === n - 1) {
                        return ans;
                    }
                    q.push([x, y]);
                    maze[x][y] = '+';
                }
            }
        }
    }
    return -1;
};
